export var ExecutionType;
(function (ExecutionType) {
    ExecutionType["web3"] = "web3";
    ExecutionType["ethers"] = "ethers";
    ExecutionType["customHttp"] = "custom";
})(ExecutionType || (ExecutionType = {}));
